import styled from "styled-components";

const Box = styled.div`
  border: 1px solid grey;
  min-width: 300px;
  min-height: 300px;
  box-shadow: 0 0 3px rgba(0, 0, 0, 0.5 );
  margin: 20px;
`
export default Box;
